import {BrowserRouter, Routes , Route} from 'react-router-dom'

function App() {
  return (
    <>
    <BrowserRouter>
      <Routes>
        <Route exact path='/' element />
      </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
